('2430','2','8362','WHG. Norma',Null,'2 Schlafzim. Wohnung in zentraler, aber ruhiger Lage in Paguera zu verkaufen','34094','Der von deutschen Urlaubern gern besuchte Urlaubsort Paguera befindet sich im Südwesten Mallorcas zwischen Santa Ponsa und Andratx. \r\nDiese Wohnung liegt nur 50m vom Boulevard Pagueras, in ruhiger Lage, entfernt. Zu verschiedenen Bars, Restaurants und Supermärkten sind es nur wenige Gehminuten. Zum Badestrand sind es nur 100m. Die 86m² Wohnfläche verteilt sich auf Wohn-Esszimmer, offene Küche, 2 Schlafzimmer und 1 ½ Badezimmer. Vom Wohnzimmer hat man Zugang zu einer 78m² großen Terrasse. Zur Ausstattung gehören eine Einbauküche und eine Klimaanlage w/k\r\n','34095','199000','106','2016-02-26 11:58:04','106','2016-02-26 11:58:37',Null,'2571','104','1206',1,'1','0',Null,Null,Null,'34096',Null,'0','0','0',Null,'2016-02-26 12:03:52',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34097',Null,'34098',Null,'34099',Null,'34100',Null,'34101','0',0,'0');
